import { Link } from "react-router-dom";
export default function Review(props) {
  const title = props.title;
  const body = props.body;
  const name = props.name;
  const id = props.key;

  return (
    <div className="my-3">
      <h3>{title}</h3>
      <small>
        <strong>{name}</strong>
      </small>
      <p>{body}</p>
      <Link to={`/reviews/new`} className="btn btn-primary col-2">
        Edit
      </Link>
      <Link to="/reviews/new" className="mx-1 btn btn-primary col-2">
        Delete
      </Link>
    </div>
  );
}
